import React, { Component } from 'react';
import './App.css';
import icon from './covid_icon.png';

export class App extends Component {
  async componentDidMount() {
    const data = await fetch('api/home');
    console.log(data)
  }

  render() {
    return (
      <div style={{ display: 'flex', backgroundColor: '#fff', flexDirection: 'column' }}>

        <div style={{ display: 'flex', margin: 20, flexDirection: 'row', alignItems: 'center', justifyContent: 'space-between' }}>
          <div style={{ display: 'flex', flexDirection: 'row', flexDirection: 'row', alignItems: 'center', }}>
            <img style={{ height: 45, marginRight: 20 }} src={icon}/>
            <p style={{ fontSize: 18 }}>World Health State - COVID-19 Epidemic</p>
          </div>

          <p style={{ fontSize: 18, fontWeight: 400 }}>BETA 0.0.1</p>
        </div>
        <div style={{ width: '100%', height: 1, backgroundColor: '#acb'}}/>


      </div>
    );
  }
}
